import React from "react";
import PropTypes from "prop-types";
import "./Table.scss";
Table.propTypes = {
  dataList: PropTypes.array.isRequired,
  headerList: PropTypes.array.isRequired,
};

function Table(props) {
  const { dataList, headerList } = props;
  return (
    <div className="TableProduct">
      <div className="HeaderTable">
        {headerList.map((header, index) => {
          return (
            <div key={index} style={{ flex: header.flex }}>
              {header.label}
            </div>
          );
        })}
      </div>
      {dataList.map((item,index) => {
        return (
          <div className="ContentTable" key={item.id}>
            {Object.keys(item).map((key, ind) => {
              return (
                <div key={key + index} style={{ flex: headerList[ind].flex }}>
                  {item[key]}
                </div>
              );
            })}
          </div>
        );
      })}
    </div>
  );
}

export default Table;
